import { useEffect } from 'react';

import { useTranslation } from 'react-i18next';

import {
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  Typography,
  Icon,
} from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({});

const iconType = {
  403: 'warning',
  200: 'check_circle',
};

export default function DialogRecordDetailLogAnalysis(props) {
  const { open, handleClose, dataDialogDetails, indexDetails } = props;
  const { t } = useTranslation('analysisPage');
  const classes = useStyles();

  function getRecordAttemptsLatencyAverage(record) {
    const attepms = record.stats.attempts || [];
    const attempsLength = attepms.length;
    const latencyTotal = attepms.reduce((acc, val) => acc + (val.latency || 0), 0);
    return latencyTotal && attempsLength ? latencyTotal / attempsLength : 0;
  }

  function getRecordAttemptsLatencySum(record) {
    const attepms = record.stats.attempts || [];
    if (attepms.length === 0) return '--';
    const latencyTotal = attepms.reduce((acc, val) => acc + (val.latency || 0), 0);
    return latencyTotal;
  }

  function msToSeconds(duration) {
    const seconds = Math.floor((duration / 1000) % 60);
    return `${seconds}`;
  }

  useEffect(() => {
    console.log('indexDetails', dataDialogDetails[indexDetails]);
  }, [dataDialogDetails, indexDetails]);

  return (
    <Dialog
      open={open}
      onClose={handleClose}
      aria-labelledby="alert-dialog-title"
      aria-describedby="alert-dialog-description"
    >
      <DialogTitle id="alert-dialog-title">{t('ANALYSIS_DIALOG_RECORD_DETAIL_TITLE')}</DialogTitle>
      <DialogContent dividers>
        <div className="flex items-start">
          <Icon className="mr-10">sync_alt</Icon>
          <div>
            <Typography>
              {t('ANALYSIS_DIALOG_RECORD_DETAIL_LATENCY')}:{' '}
              <b>
              âˆ‘ {Math.ceil(getRecordAttemptsLatencySum(dataDialogDetails[indexDetails]))} milisegundos
              </b>
            </Typography>
            <Typography>
              {t('ANALYSIS_DIALOG_RECORD_DETAIL_ATTEMPTS')}:{' '}
              <b>{dataDialogDetails[indexDetails].stats.retryAttempt}</b>
            </Typography>
            <Typography>
              {t('ANALYSIS_DIALOG_RECORD_DETAIL_TIME_ON_WAITING')}:{' '}
              <b>
                {msToSeconds(
                  dataDialogDetails[indexDetails].stats.sentTimestamp -
                    dataDialogDetails[indexDetails].timestamp
                )}{' '}
                seg
              </b>
            </Typography>
          </div>
        </div>
        <div className="mt-10">
          {dataDialogDetails[indexDetails].stats &&
            dataDialogDetails[indexDetails].stats.attempts.length > 0 && (
              <Typography># {t('ANALYSIS_DIALOG_RECORD_DETAIL_STATUS_DESCRIPTION')}</Typography>
            )}
          <div>
            {((dataDialogDetails[indexDetails].stats || {}).attempts || []).map(
              (attempt, index) => (
                <Typography className="text-xs">
                  <Icon className="mr-10 text-xs">{iconType[attempt.code]}</Icon> {attempt.code}{' '}
                  {attempt.message}
                </Typography>
              )
            )}
          </div>
        </div>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} variant="contained" color="error">
          Cerrar
        </Button>
      </DialogActions>
    </Dialog>
  );
}
